sap.ui.define(["sap/ui/core/mvc/Controller"],function(e){"use strict";var t={};return e.extend("enterprisesustainabilitypro.controller.Login",{onInit:function(){t=this.getOwnerComponent().getModel("prop");this.byId("idSimpleRegistration").setModel(new sap.ui.model.json.JSONModel)},onAction:function(e){var o=sap.ui.core.UIComponent.getRouterFor(this);if(e.getSource().getText()!=="Cancel"){e.getSource().setType("Emphasized")}if(e.getSource().getText()==="Register"){this.byId("logButton").setType("Default");t.setProperty("/vRegister",true)}if(e.getSource().getText()==="Login"){this.byId("regButton").setType("Default");if(!t.getProperty("/vRegister")){o.navTo("Invite")}else{t.setProperty("/vRegister",false)}}}})});